import './App.css';
import Main from "./main/Main.jsx";
import Login from "./login/Login.jsx";
import React from 'react';
import {Router, Route} from "react-router-dom";

function App() {
  return (
    <div>
      <Top/>
      <Bottom/>
      <React.Fragment>
        <Router>
          <Route path='/' element={<Main/>}/>
          <Route path='/login' element={<Login/>}/>
        </Router>
      </React.Fragment>
    </div>
  );
}

export default App;
